  false,\n\t\"url\": null,\n\t\"notes\": \"Objectives of the 2012 SEAMAP Reef Fish
  Survey were to collect video data of reef fish on western Gulf of Mexico shelf-edge
  banks to facilitate assessments of relative abundance and length-frequency distributions
  of reef fish species, collect otoliths from fish for age and growth analysis, collect
  profiles of conductivity, temperature, dissolved oxygen, fluorescence, and transmisivity
  at each sample site, and collect multibeam and splitbeam echosounder data at select
